#include <iostream>
#include <windows.h>

using namespace std;

double* product(double arr[], int len) {
	double* result = new double[len];
	result[0] = arr[0];
	for (int i = 1; i < len; i++) {
		result[i] = arr[i] * result[i - 1];
	}
	return result;
}
int main()
{
	SetConsoleOutputCP(1251);
	SetConsoleCP(1251);
	int N{};
	double total_product{ 1 };
	string words_array[10]{ "–ø–µ—Ä—à–∏–π", "–¥—Ä—É–≥–∏–π", "—Ç—Ä–µ—Ç—ñ–π", "—á–µ—Ç–≤–µ—Ä—Ç–∏–π", "–ø'—è—Ç–∏–π", "—à–æ—Å—Ç–∏–π", "—Å—å–æ–º–∏–π", "–≤–æ—Å—å–º–∏–π", "–¥–µ–≤'—è—Ç–∏–π", "–¥–µ—Å—è—Ç–∏–π" };
	while (true) {
		cout << "–í–≤–µ–¥—ñ—Ç—å –±–∞–∂–∞–Ω—É –∫—ñ–ª—å–∫—ñ—Å—Ç—å –µ–ª–µ–º–µ–Ω—Ç—ñ–≤ —É –º–∞—Å–∏–≤—ñ (–≤—ñ–¥ 2 –¥–æ 10): ";
		cin >> N;
		if (cin.fail() || N < 2 || N > 10) {
			cin.clear();
			cin.ignore(32767, '\n');
			cout << "–ß–∏—Å–ª–æ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
			continue;
		}
		else {
			break;
		}
	}
	double* array = new double[N];
	for (int i = 0; i < N; i++) {
		while (true) {
			cout << "–í–≤–µ–¥—ñ—Ç—å " << words_array[i] << " –µ–ª–µ–º–µ–Ω—Ç –º–∞—Å–∏–≤—É: ";
			cin >> array[i];
			if (cin.fail()) {
				cin.clear();
				cin.ignore(32767, '\n');
				cout << "–ß–∏—Å–ª–æ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ —â–µ —Ä–∞–∑!" << endl;
				continue;
			}
			else {
				break;
			}
		}
	}
	double* result = product(array, N);
	cout << "–ù–æ–≤–∏–π –º–∞—Å–∏–≤: ";
	for (int i = 0; i < N; i++) {
		cout << result[i] << " ";
		total_product *= result[i];
	}
	cout << endl << "–î–æ–±—É—Ç–æ–∫ —á–∏—Å–µ–ª –≤ –Ω–æ–≤–æ–º—É –º–∞—Å–∏–≤—ñ: " << total_product;
	delete[] array;
	delete[] result;
}

#include <iostream>
#include <windows.h>

using namespace std;

int minimal(double arr[], int len) {
	int min_index = 0;
	for (int i = 1; i < len; i++) {
		if (arr[i] < arr[min_index]) {
			min_index = i;
		}
	}
	return min_index;
}
