#include <iostream>
#include <windows.h>

using namespace std;

float root_square (float number){
	return sqrt(number);
}
int main()
{
	SetConsoleOutputCP(1251);
	SetConsoleCP(1251);
	float num{};
	while (true) {
		cout << "–í–≤–µ–¥—ñ—Ç—å –±—É–¥—å-—è–∫–µ —á–∏—Å–ª–æ: ";
		cin >> num;
		if (cin.fail()) {
			cin.clear();
			cin.ignore(32767, '\n');
			cout << "–ß–∏—Å–ª–æ –±—É–ª–æ –≤–≤–µ–¥–µ–Ω–æ –Ω–µ–ø—Ä–∞–≤–∏–ª—å–Ω–æ. –°–ø—Ä–æ–±—É–π—Ç–µ –≤–≤–µ—Å—Ç–∏ —ñ–Ω—à–µ!" << endl;
			continue;
		}
		else {
			break;
		}
	}
	if (num < 0) {
		cout << "–ù–µ–º–æ–∂–ª–∏–≤–æ –≤–∏–¥–æ–±—É—Ç–∏ –∫–æ—Ä—ñ–Ω—å –∑ –≤—ñ–¥'—î–º–Ω–æ–≥–æ —á–∏—Å–ª–∞!";
		return 0;
	}
	else {
		cout << "–ö–æ—Ä—ñ–Ω—å —á–∏—Å–ª–∞: " << root_square(num);
	}
}
